import axios from "axios";
import React, { useEffect, useState } from "react";

export const Check = () => {
  const [data, setdata] = useState([]);
  useEffect(() => {
    axios
      .get("http://localhost:3002/appointment/")
      .then((res) => {
        console.log(res.data);
        setdata(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  console.log("data", data);
  return (
    <div>
      {data.map((e) => {
        return (
          <>
            <h1>{}</h1>
          </>
        );
      })}
    </div>
  );
};
